import CircleImage from '../common/circleImage/CircleImage';
import profilePic from '../../images/github_profile.png'
import './About.css'

function About() {
  return (
    <section id='about-container' className='full-cover'>
      <div className='about-card'>
        <div className='img-container'>
          <CircleImage imagePath={profilePic} alt={'Profile Pic'} width={180} height={180}/>
        </div>
        <div className='card-info'>
          info
        </div>
      </div>
    </section>
  );
}

export default About;
